"use strict";Vue.component("subject-tree",{props:{end:{type:Boolean,require:!1,default:function(){return!1}},show:{}},data:function(){return{cashSetting:{data:{simpleData:{enable:!0,idKey:"id",pIdKey:"parentId"},key:{name:"subjectName"}},callback:{onClick:this.clickTab}},id1:1,treeValue:"name1",url:contextPath+"/incomeCategory/getListByType",choose:{name:"",value:"",isEnd:!1},treeData:{zichan:[],fuzhai:[]}}},methods:{closeModal:function(){this.$emit("close")},save:function(){this.choose.isEnd=this.end,this.$emit("save",this.choose),this.$emit("close")},clickTab:function(e,t,n){this.choose.value=n.id,this.choose.name=n.subjectName}},created:function(){var t=this;$.ajax({type:"POST",url:contextPath+"/incomeCategory/getListByType",contentType:"application/json",dataType:"json",success:function(e){t.treeData=e.data},error:function(e){alert("服务器出错啦!")}})},template:'\n        <Modal\n        title="选择科目"\n        v-model="show"\n        width="500"\n        @on-cancel=\'closeModal\'\n        :mask-closable="false">\n        <tabs v-model="treeValue" type="card">\n            <tab-pane label="资产" name="name1">\n                <ht-tree \n                    :nodeData="treeData.zichan"\n                    :setting="cashSetting"\n                    tid="id1"\n                    v-if="treeValue===\'name1\'"></ht-tree>\n            </tab-pane>\n            <tab-pane label="负债" name="name2">\n                <ht-tree \n                    :nodeData="treeData.fuzhai"\n                    :setting="cashSetting"\n                    tid="id2"\n                    v-if="treeValue===\'name2\'"></ht-tree>\n            </tab-pane>\n            <tab-pane label="共同" name="name3">\n                <ht-tree \n                    :nodeData="treeData.gongtong"\n                    :setting="cashSetting"\n                    tid="id3"\n                    v-if="treeValue===\'name3\'"></ht-tree>\n            </tab-pane>\n            <tab-pane label="权益" name="name4">\n                <ht-tree \n                    :nodeData="treeData.quanyi"\n                    :setting="cashSetting"\n                    tid="id4"\n                    v-if="treeValue===\'name4\'"></ht-tree>            \n            </tab-pane>\n            <tab-pane label="成本" name="name6">\n                <ht-tree \n                    :nodeData="treeData.chenben"\n                    :setting="cashSetting"\n                    tid="id6"\n                    v-if="treeValue===\'name6\'"></ht-tree>               \n            </tab-pane>\n            <tab-pane label="损益" name="name7">\n                <ht-tree \n                    :nodeData="treeData.shunyi"\n                    :setting="cashSetting"\n                    tid="id7"\n                    v-if="treeValue===\'name7\'"></ht-tree>             \n            </tab-pane>\n            <tab-pane label="表外" name="name8">表外</tab-pane>\n        </tabs>\n        <div slot="footer">\n            <i-button type="primary" @click="save">确定</i-button>\n            <i-button @click="closeModal">取消</i-button>\n        </div>\n    </Modal>\n    '});